import React from "react";


export default function Lista(props: any){
    return(
        <div className="ListWrapper">
            <ul>
                {props.tarefas.map((item: any, index:any) => {
                    <li key={index}>
                        {item.Model}
                        {item.Licenseplate}
                    </li> 
                })}
            </ul>
        </div>

    )
}
